INSERT INTO `querylist` VALUES (1,'Total number of endoscopic examination for different country from January 1, 2010 to December 31, 2010.\r','SELECT Country, COUNT( Report_ID ) AS TotalNum\rFROM Examination, Patient\rWHERE Examination.Patient_ID = Patient.PID\rAND Endoscopy_Date\rBETWEEN \'2010-1-1\'\rAND \'2010-12-30\'\rGROUP BY Country',1),(2,'Top 5 diagnoses for those patients who received endoscopic examination and the number of cases for each diagnosis from January 1, 2010 to December 31, 2010.\r','SELECT Diagnoses_Text, COUNT( Diagnoses_Text ) AS Num\rFROM Examination\rGROUP BY Diagnoses_Text\rHAVING COUNT( Diagnoses_Text ) >0\rLIMIT 5\r',2),(3,'Age profile of endoscopic patients from January 1, 2010 to December 31, 2010 – i.e. Number of dialysis patients belonging to each of the age bracket [below 18; 18 to below 40; 40 to below 60; 60 and above]\r','SELECT * \nFROM (\n\nSELECT DISTINCT COUNT( PID ) AS NumBelow18\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) <18\n) AS NumBelow18, (\n\nSELECT DISTINCT COUNT( PID ) AS Num18to40\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) \nBETWEEN 18 \nAND 40\n) AS Num18to40, (\n\nSELECT DISTINCT COUNT( PID ) AS Num40to60\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) \nBETWEEN 40 \nAND 60\n) AS Num40to60, (\n\nSELECT DISTINCT COUNT( PID ) AS NumAbove60\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) >60\n) AS NumAbove60\nSELECT Gender, COUNT( Patient_ID ) AS NumberofPatients\nFROM ClinicalDetection, Patient\nWHERE ClinicalDetection.Patient_ID = Patient.PID\nAND Times =1\nAND HBsAg =0\nAND Patient_ID\nIN (\nSELECT Patient_ID\nFROM ClinicalDetection\nWHERE Times =3\nAND AntiHBs =0\n)\nGROUP BY Gender\n',3),(4,'Number of patients for each gender who are still susceptible to developing a Hepatitis B infection even after full compliance to the Hepatitis B vaccination schedule —i.e. The baseline and second detection dates for the HBsAg and Anti-HBs tests turn out to be both negative results.\r','SELECT Gender,COUNT(Patient_ID) AS NumberofPatients FROM ClinicalDetection,patient WHERE ClinicalDetection.Patient_ID=patient.PID AND Times=1 AND HBsAg=0 AND Patient_ID IN (SELECT Patient_ID FROM ClinicalDetection WHERE Times=3 AND AntiHBs =0) GROUP BY Gender',4),(5,'Total number of prescription made up from January 1, 2017 to December 31, 2017.','SELECT DISTINCT COUNT(pres.PID) as PresNum FROM prescription as pres WHERE pres.Pres_Date BETWEEN \'2017-1-1\' AND \'2017-12-31\';',5),(6,'Total number of patients who received medical prescription from the doctor Tom Baker from January 1, 2017 to December 31, 2017.','SELECT DISTINCT COUNT(p.PID) FROM patient as p, doctor as d, prescription as pres WHERE p.PID = pres.Patient_ID      and d.DID = pres.Doctor_ID     and d.Name = \'Tom\' and d.Surname = \'Baker\'     and pres.Pres_Date BETWEEN \'2017-1-1\' AND \'2017-12-31\'; ',6),(7,'Age profile of patients who took the medication Acetaminophen from January 1, 2017 to December 31, 2017.','SELECT patient.PID, patient.DoB, medication.Name FROM patient, prescription, prescriptmed, medication WHERE patient.PID = prescription.Patient_ID     and prescription.PID = prescriptmed.PRESCRIPTID     and prescriptmed.MEDID = medication.MID     and prescription.Pres_Date BETWEEN \'2017-1-1\' AND \'2017-12-31\'; SELECT * FROM (     SELECT DISTINCT COUNT( PID ) AS NumBelow18    FROM PaientMed   WHERE name = \'Acetaminophen\'      AND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) <18  ) AS NumBelow18,  (     SELECT DISTINCT COUNT( PID ) AS NumBelow18    FROM PaientMed   WHERE name = \'Acetaminophen\'      AND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) BETWEEN 18  AND 40  ) AS Num18to40,  (   SELECT DISTINCT COUNT( PID ) AS NumAbove40    FROM PaientMed   WHERE name = \'Acetaminophen\'      AND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) >40  ) AS NumAbove40;',7),(8,'Top 5 medication prescripted by doctors and for each medication the number of prescriptions which took it from from January 1, 2017 to December 31, 2017.','SELECT medication.Name, COUNT(prescription.PID) as TotalNum FROM prescription, prescriptmed, medication WHERE prescription.PID = prescriptmed.PRESCRIPTID     and prescriptmed.MEDID = medication.MID     and prescription.Pres_Date BETWEEN \'2017-1-1\' AND \'2017-12-31\' GROUP BY medication.MID LIMIT 5;',8);
